import './App.css';
import './index.css';
import React from "react";

function Header() {
  return (
    <header className="cabecera container">
      <a className="logo" href="">
        <img src="./img/logo-universdad.png" width="200px" alt="Logo de la Universidad" />
      </a>
    </header>
  );
}

export default Header;
